'use client'

export * from '@studio-freight/react-lenis'
import { ReactLenis } from "lenis/dist/lenis-react";
import { motion, useMotionTemplate, useScroll, useTransform } from "framer-motion";
import { useRef } from "react";

export const SmoothScrollHero = () => {
  return (
    <div className="bg-zinc-950">
      <ReactLenis
        root
        options={{
          lerp: 0.05, // Smooth scrolling effect
        }}
      >
        <Nav />
        <Hero />
        <ProductFeatures />
        <CTA />
      </ReactLenis>
    </div>
  );
};

const Nav = () => {
  return (
    <nav className="fixed left-0 right-0 top-0 z-50 flex items-center justify-between px-6 py-3 text-white">
      <h1 className="text-2xl font-bold">Your Brand</h1>
      <button
        onClick={() => {
          document.getElementById("features-section")?.scrollIntoView({
            behavior: "smooth",
          });
        }}
        className="text-sm text-zinc-400"
      >
        Explore Features
      </button>
    </nav>
  );
};

const Hero = () => {
  return (
    <div className="h-screen relative flex items-center justify-center bg-center bg-cover" style={{ backgroundImage: "url('https://images.unsplash.com/photo-1460186136353-977e9d6085a1?q=80&w=2670&auto=format&fit=crop')" }}>
      <motion.h1
        initial={{ y: 50, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 1, ease: "easeInOut" }}
        className="text-5xl text-white font-extrabold"
      >
        Welcome to Athena
      </motion.h1>
    </div>
  );
};

const ProductFeatures = () => {
  return (
    <section id="features-section" className="bg-zinc-900 py-20">
      <motion.h2
        initial={{ y: 50, opacity: 0 }}
        whileInView={{ y: 0, opacity: 1 }}
        viewport={{ once: true }}
        transition={{ duration: 0.75, ease: "easeInOut" }}
        className="text-center text-4xl font-bold text-white mb-12"
      >
        Explore Our Features
      </motion.h2>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 px-6 max-w-7xl mx-auto">
        {features.map((feature, index) => (
          <motion.div
            key={index}
            initial={{ scale: 0.95, opacity: 0 }}
            whileInView={{ scale: 1, opacity: 1 }}
            viewport={{ once: true }}
            transition={{ delay: index * 0.2, duration: 0.5, ease: "easeInOut" }}
            className="p-6 bg-zinc-800 rounded-lg shadow-lg"
          >
            <h3 className="text-lg font-semibold text-white mb-2">{feature.title}</h3>
            <p className="text-sm text-zinc-400">{feature.description}</p>
          </motion.div>
        ))}
      </div>
    </section>
  );
};

const CTA = () => {
  return (
    <section className="bg-gradient-to-r from-blue-500 to-purple-500 py-20 text-center">
      <motion.h2
        initial={{ y: 50, opacity: 0 }}
        whileInView={{ y: 0, opacity: 1 }}
        viewport={{ once: true }}
        transition={{ duration: 0.75, ease: "easeInOut" }}
        className="text-4xl font-bold text-white mb-4"
      >
        Ready to Get Started?
      </motion.h2>
      <motion.button
        initial={{ scale: 0.9, opacity: 0 }}
        whileInView={{ scale: 1, opacity: 1 }}
        viewport={{ once: true }}
        transition={{ duration: 0.75, ease: "easeInOut" }}
        className="px-6 py-3 bg-white text-blue-500 font-bold rounded-lg"
      >
        Get Started
      </motion.button>
    </section>
  );
};

const features = [
  { title: "AI-Powered Grading", description: "Accurate and efficient grading for assignments, quizzes, and exams." },
  { title: "Personalized Learning Paths", description: "Customized resources to help students improve based on their weaknesses." },
  { title: "Real-Time Feedback", description: "Instant feedback to improve understanding and retention." },
  { title: "Teacher Dashboards", description: "Comprehensive insights and tools for managing classrooms." },
  { title: "Student Profiles", description: "Detailed profiles showcasing strengths and areas for improvement." },
  { title: "Multi-Platform Support", description: "Accessible from any device, anytime, anywhere." },
];
